import React, { Component } from 'react';

class Second extends Component {

    constructor(props) {
        super(props)

        this.state = {
             massage: "navid"
        }
    }



    render() { 
        return ( 
            <div>
                <h1>{this.state.name}</h1>
                <button>click me!!!!</button>
            </div>
         );
    }
}

export default Second;
